import React, { useState } from 'react';
import { Container, Row, Col, Form, Button, Card } from 'react-bootstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import Layout from '../components/Layout';

const Contact = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    subject: '',
    message: ''
  });
  const [validated, setValidated] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevData => ({
      ...prevData,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    const form = e.currentTarget;
    e.preventDefault();

    if (form.checkValidity() === false) {
      e.stopPropagation();
    } else {
      // Handle form submission logic here
      console.log('Form submitted:', formData);
      // Reset form after submission
      setFormData({
        name: '',
        email: '',
        subject: '',
        message: ''
      });
    }

    setValidated(true);
  };

  const contactMethods = [
    {
      icon: 'map-marker-alt',
      title: 'Our Location',
      details: '123 University Ave, College Town, ST 12345',
      color: 'primary'
    },
    {
      icon: 'envelope',
      title: 'Email Us',
      details: 'contact@collegeevents.edu',
      color: 'success'
    },
    {
      icon: 'phone',
      title: 'Call Us',
      details: '(555) 123-4567',
      color: 'danger'
    },
    {
      icon: 'clock',
      title: 'Office Hours',
      details: 'Monday-Friday: 9AM-5PM',
      color: 'info'
    }
  ];

  return (
    <Layout>
      {/* Hero Section */}
      <section className="hero-section">
        <Container>
          <Row className="align-items-center">
            <Col lg={7} data-aos="fade-right">
              <h1>Get In Touch</h1>
              <p className="lead">Have questions about our events or want to collaborate with us? Reach out and we'll be happy to help!</p>
            </Col>
            <Col lg={5} className="d-none d-lg-block" data-aos="fade-left">
              <img 
                src="https://images.unsplash.com/photo-1551836022-d5d88e9218df?ixlib=rb-1.2.1&auto=format&fit=crop&w=1350&q=80" 
                alt="Contact us" 
                className="img-fluid rounded shadow"
                style={{ transform: 'rotate(2deg)' }}
              />
            </Col>
          </Row>
        </Container>
      </section>

      {/* Contact Info Cards */}
      <Container className="py-5">
        <Row>
          {contactMethods.map((method, index) => (
            <Col md={3} sm={6} className="mb-4" key={index} data-aos="fade-up" data-aos-delay={100 * (index + 1)}>
              <Card className="event-card h-100 text-center">
                <Card.Body>
                  <div className={`rounded-circle bg-${method.color} d-flex align-items-center justify-content-center mx-auto mb-4`} style={{ width: '70px', height: '70px' }}>
                    <FontAwesomeIcon icon={method.icon} size="lg" className="text-white" />
                  </div>
                  <Card.Title>{method.title}</Card.Title>
                  <Card.Text>{method.details}</Card.Text>
                </Card.Body>
              </Card>
            </Col>
          ))}
        </Row>
      </Container>

      {/* Contact Form */}
      <Container className="py-5">
        <Row>
          <Col lg={6} className="mb-5 mb-lg-0" data-aos="fade-right">
            <h2 className="section-heading text-start">Send Us a Message</h2>
            <p className="mb-4">Fill out the form below and we'll get back to you as soon as possible.</p>

            <Form noValidate validated={validated} onSubmit={handleSubmit}>
              <Row>
                <Col md={6} className="mb-3">
                  <Form.Group controlId="contactName">
                    <Form.Label>Your Name</Form.Label>
                    <Form.Control
                      type="text"
                      placeholder="Enter your name"
                      name="name"
                      value={formData.name}
                      onChange={handleChange}
                      required
                    />
                    <Form.Control.Feedback type="invalid">
                      Please provide your name.
                    </Form.Control.Feedback>
                  </Form.Group>
                </Col>
                <Col md={6} className="mb-3">
                  <Form.Group controlId="contactEmail">
                    <Form.Label>Your Email</Form.Label>
                    <Form.Control
                      type="email"
                      placeholder="Enter your email"
                      name="email"
                      value={formData.email}
                      onChange={handleChange}
                      required
                    />
                    <Form.Control.Feedback type="invalid">
                      Please provide a valid email.
                    </Form.Control.Feedback>
                  </Form.Group>
                </Col>
              </Row>

              <Form.Group className="mb-3" controlId="contactSubject">
                <Form.Label>Subject</Form.Label>
                <Form.Control
                  type="text"
                  placeholder="What is this regarding?"
                  name="subject"
                  value={formData.subject}
                  onChange={handleChange}
                  required
                />
                <Form.Control.Feedback type="invalid">
                  Please provide a subject.
                </Form.Control.Feedback>
              </Form.Group>

              <Form.Group className="mb-3" controlId="contactMessage">
                <Form.Label>Message</Form.Label>
                <Form.Control
                  as="textarea"
                  rows={6}
                  placeholder="Your message here..."
                  name="message"
                  value={formData.message}
                  onChange={handleChange}
                  required
                />
                <Form.Control.Feedback type="invalid">
                  Please provide your message.
                </Form.Control.Feedback>
              </Form.Group>

              <Button type="submit" variant="primary" size="lg" className="rounded-pill px-5">
                <FontAwesomeIcon icon="paper-plane" className="me-2" />
                Send Message
              </Button>
            </Form>
          </Col>

          <Col lg={6} data-aos="fade-left">
            <div className="h-100 d-flex flex-column">
              <div className="mb-4">
                <h2 className="section-heading text-start">Visit Our Office</h2>
                <p>We're located in the Student Center, Room 301. Stop by during office hours to chat with our team in person.</p>
                <div className="d-flex mb-4">
                  <FontAwesomeIcon icon="map-marker-alt" size="lg" className="text-primary me-3 mt-1" />
                  <div>
                    <h5>Campus Location</h5>
                    <p className="mb-0">123 University Ave<br />College Town, ST 12345<br />United States</p>
                  </div>
                </div>
              </div>

              {/* Map */}
              <div className="flex-grow-1 rounded overflow-hidden shadow-lg position-relative">
                <div className="bg-light h-100 d-flex align-items-center justify-content-center">
                  <div className="text-center p-4">
                    <FontAwesomeIcon icon="map-marked-alt" size="3x" className="text-primary mb-3" />
                    <h5>Interactive Map Coming Soon</h5>
                    <p className="mb-0">We're working on adding an interactive campus map to help you find us easily!</p>
                  </div>
                </div>
              </div>
            </div>
          </Col>
        </Row>
      </Container>

      {/* FAQ Section */}
      <div className="bg-light py-5">
        <Container>
          <h2 className="section-heading" data-aos="fade-up">Frequently Asked Questions</h2>
          <Row className="justify-content-center">
            <Col lg={10}>
              <div className="accordion" id="contactFAQ">
                {[
                  {
                    question: 'How can I propose an event idea?',
                    answer: 'We welcome event ideas from students! You can submit your proposal using our online form or schedule a meeting with one of our event coordinators to discuss your idea in detail.'
                  },
                  {
                    question: 'How do I reserve a space for my club event?',
                    answer: 'Registered student organizations can reserve spaces through the student portal. Log in, navigate to "Event Spaces," check availability, and submit your request at least two weeks in advance.'
                  },
                  {
                    question: 'Can I volunteer to help with college events?',
                    answer: "Absolutely! We are always looking for volunteers. Fill out the volunteer application form on our website, and we will match you with events that align with your interests and availability."
                  },
                  {
                    question: 'How can faculty get involved with events?',
                    answer: 'Faculty can participate by proposing academic events, serving as advisors for student-led initiatives, or attending our monthly planning sessions. Contact us for more information on current opportunities.'
                  }
                ].map((faq, index) => (
                  <div className="card mb-3 border-0 shadow-sm" key={index} data-aos="fade-up" data-aos-delay={100 * (index + 1)}>
                    <div className="card-header bg-white" id={`heading${index}`}>
                      <h5 className="mb-0">
                        <button 
                          className="btn btn-link w-100 text-start d-flex justify-content-between text-decoration-none" 
                          type="button" 
                          data-bs-toggle="collapse" 
                          data-bs-target={`#collapse${index}`}
                        >
                          {faq.question}
                          <FontAwesomeIcon icon="chevron-down" />
                        </button>
                      </h5>
                    </div>
                    <div 
                      id={`collapse${index}`} 
                      className="collapse" 
                      aria-labelledby={`heading${index}`} 
                      data-bs-parent="#contactFAQ"
                    >
                      <div className="card-body">
                        {faq.answer}
                      </div>
                    </div>
                  </div>
                ))}
              </div>
            </Col>
          </Row>
        </Container>
      </div>

      {/* Social Media Connect */}
      <Container className="py-5 text-center" data-aos="fade-up">
        <h2 className="section-heading">Connect With Us</h2>
        <p className="lead mb-5">Follow us on social media for event updates, behind-the-scenes content, and more!</p>
        <Row className="justify-content-center">
          <Col lg={8}>
            <div className="d-flex justify-content-center flex-wrap gap-4">
              {[
                { icon: ['fab', 'facebook-f'], color: '#3b5998', name: 'Facebook' },
                { icon: ['fab', 'twitter'], color: '#1da1f2', name: 'Twitter' },
                { icon: ['fab', 'instagram'], color: '#e1306c', name: 'Instagram' },
                { icon: ['fab', 'youtube'], color: '#ff0000', name: 'YouTube' },
                { icon: ['fab', 'linkedin-in'], color: '#0077b5', name: 'LinkedIn' }
              ].map((social, index) => (
                <a 
                  href="#" 
                  key={index}
                  className="d-flex flex-column align-items-center text-decoration-none"
                  data-aos="zoom-in"
                  data-aos-delay={100 * (index + 1)}
                >
                  <div 
                    className="rounded-circle d-flex align-items-center justify-content-center mb-2"
                    style={{ 
                      width: '80px', 
                      height: '80px', 
                      backgroundColor: social.color,
                      color: 'white',
                      fontSize: '2rem',
                      transition: 'all 0.3s ease'
                    }}
                  >
                    <FontAwesomeIcon icon={social.icon} />
                  </div>
                  <span>{social.name}</span>
                </a>
              ))}
            </div>
          </Col>
        </Row>
      </Container>
    </Layout>
  );
};

export default Contact;
